import React from 'react';

const Row = (props) => {

  return (
    <div className="card">
      <h1>{props.title}</h1>
      <ul>
        {props.data.map((d) => (
          d.map((obj) =>
            <li>{obj.value}</li>
          )
        ))}
      </ul>
    </div>
  );

}

export default Row;
